import { NavLink } from "react-router-dom";

const navBar = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <h1>Hello 1</h1>
            {/* <NavLink href="/first">First Interface</NavLink> */}
          </li>
          <li>
            {/* <NavLink href="/second">Second Interface</NavLink> */}
          </li>
          <li>
            {/* <NavLink href="/third">Third Interface</NavLink> */}
          </li>
          <li>
            {/* <NavLink href="/forth">Forth Interface</NavLink> */}
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default navBar;
